import React from 'react';
import Accordion from '../../components/Accordion';

const ResumeRepository: React.FC = () => {
    const data = [
        {
            photo: 'default.png',
            name: 'Mohit',
            gmail: 'mohit@gmail.com',
            technology: 'JavaScript',
            education: 'Computer Science',
            educationYear: '2020',
            skills: 'React, Node.js',
            experience: '2 years',
            recentEmployee: 'ABC Corp',
            portfolioLink: 'http://portfolio.com/mohit',
        },
        // Add more data objects as needed
    ];

    return (
        <div className='emp-main p-5'>
            <div className="d-flex flex-row">
                <div>
                    <div className='d-none d-md-block flex-grow-1'></div> {/* Hidden on small screens */}
                    <div className="flex-grow-1 text-start text-md-start"><h3>Name</h3></div>
                    <div className="flex-grow-1 text-start text-md-start"><h3>Email</h3></div>
                    <div className="flex-grow-1 text-start text-md-start"><h3>Technology</h3></div>
                    <div className="flex-grow-1 text-start text-md-start"><h3>Education Year</h3></div>
                    <div className="flex-grow-1 text-center text-md-start"><h3>Action</h3></div>
                </div>
                <Accordion data={data} />
            </div>

        </div>
    );
};

export default ResumeRepository;
